import React from 'react';
import { Link } from 'react-router-dom';//import Link from React Router
import './Home.css';
import logo from './logo.png.webp'; //import logo here


const Home = () => {
  return (
    <div>

      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="navbar-left">
          <img src={logo} alt="Real Wealth Logo" className="logo" />{/*Logo image*/}
        </div>
        <ul className="nav-links">
          <li><Link to="/home">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/investments">Investments</Link></li>
          <li><Link to="/contact">Contact</Link></li>
        </ul>

        <div className="auth-buttons">
          <button className="register-button">Register</button>
          <button className="login-button">Login</button>
        </div>
      </nav>

      {/* Home Section */}
      <div className="home-container">

        <h1>Welcome to Real Wealth</h1>

        <p>Your gateway to smart real estate investments.</p>

        <p>Discover how Real Wealth can transform your approach to real estate investment. Our platform connects investors to high-potential real estate opportunities, combining expertise, transparency, and growth potential. Whether you're a seasoned investor or new to real estate, Real Wealth offers pathways to financial independence through strategic property investments.
</p>
        <p>Why Real Wealth?

Curated Opportunities: We focus on well-researched, high-growth potential investments.
Ease of Access: Our platform provides streamlined tools for managing and tracking investments.
Transparency and Trust: With real-time data, we keep you informed every step of the way.</p>

        <button className="cta-button">Get Started</button>
      </div>
      </div>

 )
};

export default Home;
